import { combineReducers } from 'redux';
import dataReducer from './default-reducer';
import Login from './../pages/login/Reducer';
import Flight from '../pages/flight/Reducer';
import User from './../pages/user/Reducer'
import Register from '../pages/register/Reducer'
import ChangePassword from '../pages/change-password/Reducer'
import Report from '../pages/report/Reducer'
import Dashboard from '../pages/dashboard/Reducer';
import Setting from '../pages/setting/Reducer';
import DataCustomers from '../pages/user/traveler/Reducer';
import Alertmessage from './../component/Alert/Reducer';
import DataListAgentSub from '../pages/agents/Reducer';
import DataWithdrawal from '../pages/withdrawal/Reducer.js';
import TopUp from '../pages/top-up/Reducer.js';
import Order from '../pages/order/Reducer.js';
import PackageTour from '../pages/package-tour/Reducer.js';
import Umrah from '../pages/umrah/redux/reducer';

const rootReducers = combineReducers({
  global: dataReducer,
  login: Login,
  flight: Flight,
  user: User,
  register: Register,
  changePassword: ChangePassword,
  report: Report,
  dashboard: Dashboard,
  setting: Setting,
  customers: DataCustomers,
  alertmessage: Alertmessage,
  listdataagentsub: DataListAgentSub,
  listwithdrawal: DataWithdrawal,
  topup: TopUp,
  order: Order,
  packagetour: PackageTour,
  umrah: Umrah,
});

export default rootReducers;
